import React from 'react';
import { useSelector } from 'react-redux';

const TasksListContent = () => {
    const { tasks } = useSelector(state => state.getTasksReducer.tasks);

    console.log(tasks)

    return (
        <div>
        {tasks.forEach(task => (
            <h1>{task.title}</h1>
        ))}
        </div>
    );
};

export default TasksListContent;
